import React from 'react';

function App(){
  return(
<div>
<div className="relative">
    <img src="./images/Desktop.jpeg" alt="study" width="100%" height="100%"/>
  </div>
    <div>
        <img src='./images/logo.png' width="30" height="30" alt="logo"/>
      <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbar-list-4" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
        <span class="navbar-toggler-icon"></span>
      </button>
      <div class="collapse navbar-collapse" id="navbar-list-4">
              <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRY9nwdBkNhkd_1ftkhywXUIxuWXI7HRfCGHw&usqp=CAU" width="40" height="40" class="rounded-circle"/>
      </div>

    </div>
</div>
  );
}
export default App;
